import React from 'react';
import styles from './ChangePasswordLink.module.css';

const ChangePasswordLink = ({ onClick }) => {
    return (
        <button onClick={onClick} className={styles.link}>
            Change Password
        </button>
    );
};

export default ChangePasswordLink;
